export const Container = styled.div`
    position: fixed;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    background-color: rgba(0,0,0, 0.8);

> .ui-modal {
    /*b
    border-radius: 5px;
    max-width: 800px;
    margin: 80px auto 0 auto;
    padding: 15px;*/
    ackground-color: #fff;
    padding: 14px 16px;
    border-bottom: 1px solid var(--outline);
    max-width: 100%;
  }

> .ui-close-button {
    float: right;
    background: unset;
    border: unset;
  }

`;
